import { Home, Logout, PersonOutline } from "@mui/icons-material";
import { Tabs, Tab } from "@mui/material";

const SideBar = () => {
  const value = 0;
  return (
    <Tabs orientation="vertical" value={value}>
      <Tab icon={<Home />} label="Accueil" iconPosition="start" value={1} />
      <Tab
        icon={<PersonOutline />}
        label="Profil"
        iconPosition="start"
        value={2}
      />
      <Tab icon={<Logout />} label="Deconnexion" iconPosition="start"></Tab>
    </Tabs>
  );
};

export default SideBar;
